import React from 'react';
import Login from './components/login';
import Main from './components/main';
import Regestration from './components/regectration';
import './App.css';
import { Provider } from "react-redux";
import { createStore } from 'redux';
import { Route, Link, BrowserRouter as Router } from "react-router-dom";
// import Reducer from './redux/reducer';
// import { addObj } from "./redux/actions";
// console.log(addObj)



const startStore = {
  users:[]
} 
const store = createStore(reducer);

store.subscribe(()=>{
  console.log(store.getState())
})


function reducer(state = startStore, action:any):any{
  let newObj = JSON.parse(JSON.stringify(state))
  switch (action.type){
    case 'ADD_OBJ':
      return {
        ...newObj,
        users: newObj.users.concat(action.obj)
      }

    default:
      return state;
  }
}

